oxy_webhelp_navlinks = {"feature_description_related_to_one_functional_area_intro-d43829e6481":{"topics":[{"title":"Tax calculation by ruleset with array of values","shortdesc":"<p class=\"shortdesc\">The tax calculation for claims, surrenders, and annuities         was improved to allow the use of rulesets with multiple rates.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_149524_en\/code_149524_functional.html","attributes":{"data-id":"code_149524_functional"},"menu":{"hasChildren":false},"tocID":"code_149524_functional-d43829e6498","topics":[]},{"title":"Transferências para congénere","shortdesc":"<p class=\"shortdesc\">Encontra-se disponível         uma nova         área         para gerir as transferências para         congéneres.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_180369_en\/code_180369_functional.html","attributes":{"data-id":"code_180369_functional"},"menu":{"hasChildren":false},"tocID":"code_180369_functional-d43829e6516","topics":[]},{"title":"Regras fiscais   do país  da entidade recebedora","shortdesc":"<p class=\"shortdesc\">Esta funcionalidade tem como objetivo         permitir a         utilização         das         regras fiscais         do         país         da morada da entidade recebedora.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_169442_en\/code_169442_functional.html","attributes":{"data-id":"code_169442_functional"},"menu":{"hasChildren":false},"tocID":"code_169442_functional-d43829e6560","topics":[]},{"title":"Criação de resgates parciais e totais","shortdesc":"<p class=\"shortdesc\">A criação de resgates (parciais e totais) está agora         disponível nas novas interfaces de gestão de apólices.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_154663_en\/code_154663_functional.html","attributes":{"data-id":"code_154663_functional"},"menu":{"hasChildren":false},"tocID":"code_154663_functional-d43829e6613","topics":[]},{"title":"Improvements to the payments to professionals process","shortdesc":"<p class=\"shortdesc\">In this scope, improvements were made in the areas of     registration of claim receiving entities, issue of indemnities by process and creation of     payments to professionals.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_151118_en\/code_151118_functional.html","attributes":{"data-id":"code_151118_functional"},"menu":{"hasChildren":false},"tocID":"code_151118_functional-d43829e6631","topics":[]},{"title":"Exclusividade de sinistros em apólices de grupo","shortdesc":"<p class=\"shortdesc\">Esta funcionalidade tem como objetivo alargar às apólices de grupo a possibilidade de configurar exclusividade de sinistros.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_156489_en\/code_156489_functional.html","attributes":{"data-id":"code_156489_functional"},"menu":{"hasChildren":false},"tocID":"code_156489_functional-d43829e6649","topics":[]},{"title":"Validação da existência de direitos adquiridos nos serviços WS185 e WS192","shortdesc":"<p class=\"shortdesc\">Os serviços que devolvem as entidades recebedoras por         sinistro foram alterados de forma a validarem a existência de direitos adquiridos dos         participantes da apólice e devolverem as entidades recebedoras válidas para o sinistro em         questão.<\/p>","href":"modules\/cleva_life_v7\/feature\/lfe_cla\/code_168937_en\/code_168937_functional.html","attributes":{"data-id":"code_168937_functional"},"menu":{"hasChildren":false},"tocID":"code_168937_functional-d43829e6667","topics":[]}]}};